import Input from './Input';
import formData from '../data/formData';

function Form(props) {
  return <form className="flex flex-col" action="#">{
    formData.map((e)=>{
      return (
        <Input
        labelName={e.labelName}
        typeInput={e.typeInput}
        placeholderInput={e.placeholder}
        key={e.placeholderInput}
        />)
      })}</form>}

      export default Form;
